Біологічний захист рослин — фундаментально-прикладна галузь знань, предметом досліджень якої є біоагенти та біорегулятори — природні та генетично змінені організми та їхні генні продукти.До агентів біометоду належать: 
* хижаки, паразити й ентомопатогени — проти шкідників; 
* рослиноїдні тварини та фітопатогени — проти бур'янів рослин; 
* антагоністичні мікроорганізми, їхні метаболіти та індуктори — стійкість рослин проти хвороб рослин. Суть біологічного захисту рослин полягає у використанні проти шкідливих організмів їхніх природних ворогів (хижаки, паразити, гербіфаги) і продуктів їхньої життєдіяльності (антибіотики, гормони, феромони тощо).Головна мета біологічного захисту рослин — отримання високоякісної (екологічно безпечної) продукції за умови збереження біологічного різноманіття біоценозів.Серед піонерів пропагування, розробки та практичного використання біологічного захисту рослин - вчені, імена яких пов'язані з Україною: І.І. Мечніков, С.О. Мокржецький, Й.А. Порчинський, М.А. Теленга, М.П. Дядечко, М.Д. Зерова, О.І. Воронцов.На сьогодні в Україні значну роботу з біометоду проводять: Національний університет біоресурсів і природокористування України, Інститут захисту рослин НААН України, Інститут мікробіології, Інженерно-технологічний інститут «Біотехніка» та інші наукові установи та лабораторії.В арсеналі біологічного захисту рослин на сьогодні є потрібний комплекс засобів, зокрема ентомофагів і біопрепаратів, які дають можливість отримувати безпечну рослинну продукцію.
